CREATE TABLE `epicpay_customer_subscriptions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `customer_id` int(10) unsigned DEFAULT NULL,
  `customer_source_id` int(10) unsigned DEFAULT NULL,
  `church_id` int(11) unsigned DEFAULT NULL,
  `campus_id` int(11) unsigned DEFAULT NULL,
  `account_donor_id` int(11) unsigned DEFAULT NULL,
  `first_name` varchar(128) DEFAULT NULL,
  `last_name` varchar(128) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `zip` varchar(50) DEFAULT NULL,
  `giving_source` varchar(50) DEFAULT NULL,
  `giving_type` varchar(50) DEFAULT NULL,
  `tags` varchar(100) DEFAULT NULL,
  `frequency` varchar(50) DEFAULT NULL,
  `start_on` datetime DEFAULT NULL,
  `next_payment_on` datetime DEFAULT NULL,
  `multi_transaction_data` longtext DEFAULT NULL,
  `multi_transaction_data_bkup` text DEFAULT NULL,
  `amount` decimal(15,2) DEFAULT NULL,
  `request_data` longtext DEFAULT NULL,
  `request_response` longtext DEFAULT NULL,
  `request_response_update` longtext DEFAULT NULL,
  `stopsub_request` longtext DEFAULT NULL,
  `stopsub_response` longtext DEFAULT NULL,
  `epicpay_customer_id` varchar(50) DEFAULT NULL,
  `epicpay_wallet_id` varchar(50) DEFAULT NULL,
  `epicpay_subscription_id` varchar(50) DEFAULT NULL,
  `epicpay_template` varchar(50) DEFAULT NULL,
  `src` varchar(50) DEFAULT NULL,
  `is_fee_covered` tinyint(4) DEFAULT 0,
  `trial_days` int(10) unsigned DEFAULT NULL,
  `status` char(1) DEFAULT 'U',
  `c_status` enum('on_trial','active','unpaid','cancelled') DEFAULT NULL COMMENT 'Calculated subscription status',
  `trial_status` enum('active','ended') DEFAULT NULL COMMENT 'Trial period status',
  `access_period_status` enum('active','ended') DEFAULT NULL COMMENT 'Access period status',
  `trial_ends_at` datetime DEFAULT NULL COMMENT 'When trial period ends',
  `ends_at` datetime DEFAULT NULL COMMENT 'When subscription access ends',
  `created_as_trial` tinyint(1) unsigned DEFAULT 0 COMMENT 'Whether subscription was created with trial',
  `last_transaction_id` int(10) unsigned DEFAULT NULL,
  `status_calculated_at` datetime DEFAULT NULL COMMENT 'When status was last calculated',
  `webhook_closed` tinyint(1) unsigned NOT NULL DEFAULT 0,
  `webhook_last_state_sent` text DEFAULT NULL,
  `webhook_sent_log` longtext DEFAULT NULL,
  `last_unpaid_log_at` datetime DEFAULT NULL,
  `migrated` char(1) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `cancelled_at` datetime DEFAULT NULL,
  `from_stripemigration_sid` int(10) unsigned DEFAULT NULL,
  `done_temp` tinyint(4) DEFAULT NULL,
  `campaign_id` int(10) unsigned DEFAULT NULL,
  `ispaysafe` tinyint(3) unsigned DEFAULT NULL,
  `success_trxns` int(10) unsigned DEFAULT NULL,
  `fail_trxns` int(10) unsigned DEFAULT NULL,
  `payment_link_products_id` int(10) unsigned DEFAULT NULL COMMENT 'payment_link_products.ID',
  `white_label_tag` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_epsub_customer_id` (`customer_id`),
  KEY `idx_epsub_source_id` (`customer_source_id`),
  KEY `idx_epsub_epicpay_indexes` (`epicpay_customer_id`,`epicpay_wallet_id`,`epicpay_subscription_id`),
  KEY `idx_epsub_church_id` (`church_id`),
  KEY `idx_epsub_created_at` (`created_at`),
  KEY `idx_epsub_updated_at` (`updated_at`),
  KEY `idx_epsub_campus_id` (`campus_id`),
  KEY `epicpay_template` (`epicpay_template`),
  KEY `campaign_id` (`campaign_id`),
  KEY `payment_link_products_id` (`payment_link_products_id`),
  KEY `idx_webhook_closed` (`webhook_closed`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;
