DROP TABLE IF EXISTS `epicpay_customer_transactions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `epicpay_customer_transactions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) unsigned NOT NULL,
  `customer_source_id` int(11) unsigned NOT NULL,
  `customer_subscription_id` int(11) unsigned DEFAULT NULL,
  `church_id` int(11) unsigned DEFAULT NULL,
  `campus_id` int(11) unsigned DEFAULT NULL,
  `account_donor_id` int(11) DEFAULT NULL,
  `batch_id` int(11) DEFAULT NULL,
  `batch_method` varchar(50) DEFAULT NULL,
  `batch_committed` char(1) DEFAULT NULL,
  `batch_extra_data` longtext DEFAULT NULL,
  `sub_total_amount` decimal(15,2) DEFAULT NULL,
  `total_amount` decimal(15,2) DEFAULT NULL,
  `fee` decimal(15,2) DEFAULT 0.00,
  `first_name` varchar(100) DEFAULT NULL,
  `last_name` varchar(100) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `phone` varchar(50) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `note` varchar(255) DEFAULT NULL,
  `country` varchar(100) DEFAULT NULL,
  `city` varchar(100) DEFAULT NULL,
  `apartment` varchar(100) DEFAULT NULL,
  `state` varchar(100) DEFAULT NULL,
  `zip` varchar(100) DEFAULT NULL,
  `kiosk` varchar(100) DEFAULT NULL,
  `member_id` varchar(100) DEFAULT NULL,
  `giving_source` varchar(50) DEFAULT NULL,
  `event_data` longtext DEFAULT NULL,
  `giving_type` varchar(50) DEFAULT NULL,
  `tags` varchar(100) DEFAULT NULL,
  `multi_transaction_data` longtext DEFAULT NULL,
  `multi_transaction_data_bkup` longtext DEFAULT NULL,
  `request_data` longtext DEFAULT NULL,
  `request_response` longtext DEFAULT NULL,
  `refund_request` longtext DEFAULT NULL,
  `refund_response` longtext DEFAULT NULL,
  `created_from` char(1) DEFAULT 'D' COMMENT 'D -> Default | M -> Manual download from epicpay (recurrent_payment, not triggered by the callback)',
  `src_account_type` varchar(16) DEFAULT NULL,
  `epicpay_customer_id` varchar(50) DEFAULT NULL,
  `epicpay_wallet_id` varchar(50) DEFAULT NULL,
  `epicpay_transaction_type` varchar(15) DEFAULT NULL,
  `epicpay_transaction_id` varchar(50) DEFAULT NULL,
  `status` char(1) DEFAULT 'U',
  `status_ach` char(1) DEFAULT NULL COMMENT 'W : Waiting for confirmation | P : Proccessed | N : Rejected',
  `fts_status_id` int(11) DEFAULT NULL COMMENT 'Only used for tracking fts ACH status changes, for now',
  `transaction_batch_id` varchar(50) DEFAULT NULL COMMENT 'The batch the payment processor assigns for settlement',
  `manual_failed` smallint(5) unsigned DEFAULT NULL COMMENT '1 if the transaction was set as failed manually by the user',
  `ach_reject_response` longtext DEFAULT NULL,
  `migrated` char(1) DEFAULT NULL,
  `migration_tr_id` varchar(100) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `cancelled_at` datetime DEFAULT NULL,
  `src` varchar(50) DEFAULT NULL,
  `bank_type` varchar(5) DEFAULT NULL,
  `template` varchar(50) DEFAULT NULL,
  `is_fee_covered` tinyint(4) NOT NULL DEFAULT 0,
  `from_domain` varchar(64) DEFAULT NULL,
  `donor_ip` varchar(45) DEFAULT NULL,
  `stripe_id` int(10) unsigned DEFAULT NULL,
  `notfished_on_whook` tinyint(4) DEFAULT NULL,
  `amount_upd` decimal(10,2) DEFAULT NULL,
  `campaign_id` int(10) unsigned DEFAULT NULL,
  `amount_acum` decimal(15,2) DEFAULT 0.00,
  `fee_acum` decimal(15,2) DEFAULT 0.00,
  `trx_ret_id` int(11) DEFAULT NULL,
  `trx_retorigin_id` int(11) DEFAULT NULL,
  `trx_type` char(2) DEFAULT 'DO',
  `paysafeRef` varchar(128) DEFAULT NULL,
  `manual_trx_type` char(2) DEFAULT NULL COMMENT 'It is when adding a transaction comming not from a donor directly, commonly added by the dashboard admin, it can be a normal transaction, a donation, a expense, batches, etc ...',
  `transaction_detail` text DEFAULT NULL,
  `invoice_id` int(11) DEFAULT NULL COMMENT 'When a payment is from an invoice',
  `user_wallet` varchar(100) DEFAULT NULL,
  `exchange_rate` decimal(10,3) DEFAULT NULL,
  `crypto_amount` varchar(30) DEFAULT NULL,
  `payment_link_id` int(11) DEFAULT NULL,
  `receipt_file_uri_hash` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_epct_customer_id` (`customer_id`,`customer_source_id`),
  KEY `idx_epct_epicpay_transaction_id` (`epicpay_transaction_id`),
  KEY `idx_epct_church_id` (`church_id`),
  KEY `idx_epct_batch_id` (`batch_id`),
  KEY `idx_epct_created_at` (`created_at`),
  KEY `idx_epct_updated_at` (`updated_at`),
  KEY `campaign_id` (`campaign_id`),
  KEY `paysafeRef` (`paysafeRef`),
  KEY `manual_trx_type` (`manual_trx_type`),
  KEY `transaction_detail` (`transaction_detail`(192)),
  KEY `invoice_id` (`invoice_id`),
  KEY `payment_link_id` (`payment_link_id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci COMMENT='If a transaction comes from a campus (campus_id) it must include its main organization too';
/*!40101 SET character_set_client = @saved_cs_client */;

